import React, { useRef, useState } from "react";

  // import Swiper JS
  import { Swiper, SwiperSlide } from "swiper/react";
  import { Pagination, Autoplay, Navigation } from "swiper";

  // import Swiper styles
  import 'swiper/css';
  import 'swiper/css/pagination';
  import 'swiper/css/navigation';
  


function TopProducts() {
  return (
    <div className='flex flex-col justify-center items-center mt-32'>   
        <h1 className='font-semibold text-[25px]'>Populer Products From All Brands</h1>
        <div className='flex justify-center items-center mt-44 bg-[#e3e3e3]'>
            <Swiper
            slidesPerView={3}
            spaceBetween={30}
            centeredSlides={true}
            autoplay={{
              delay: 4000,
              disableOnInteraction: false,
            }}
            pagination={{
              clickable: true,
            }}
            navigation={true}
            modules={[Autoplay, Navigation, Pagination]}
            className='w-screen'
            >

        <SwiperSlide className="">
          <div className="bg-[#212121]">
            <h1>Product</h1>
            <p>Lorem ipsum dolor sit amet consectetur, adipisicing elit. Eos quidem incidunt quisquam deleniti reprehenderit fuga quo in dolor cum molestiae. Quisquam quia, impedit distinctio alias error voluptates architecto ea voluptas?</p>
          </div>
        </SwiperSlide>
        <SwiperSlide>Slide ASAS3</SwiperSlide>
        <SwiperSlide>Slide AS4</SwiperSlide>
        <SwiperSlide>Slide AS5</SwiperSlide>
        <SwiperSlide>Slide AS6</SwiperSlide>
        <SwiperSlide>SlideAS 7</SwiperSlide>
        <SwiperSlide>Slide AS8</SwiperSlide>
        <SwiperSlide>Slide AS9</SwiperSlide>
          </Swiper>

        </div>
    </div>  
  )
}

export default TopProducts
